// Hard-code the values for the near-field resistance functions. The functions are computed
// as the difference between the exact resistance functions computed by Jeffrey and Onishi:
//     1. Jeffrey, D.J. and Onishi, Y.
//        Calculation of the resistance and mobility functions for two unequal spheres in low-Reynolds-number flow
//        J. Fluid Mech. (1984)
//     2. Jeffrey
//        The calculation of the low Reynolds number resistance functions for two unequal spheres
//        Phys. Fluids (1992)
//     Fortran code to produce these functions is available from:
//         http://www.apmaths.uwo.ca/~djeffrey/resist_func/resist.html
// and the 2-body contribution from the far-field multipole expansion.//
// For monodisperse suspensions, there are 22 independent resistance functions 
// that need to be tabulated, plus the tabulation distances, for a total of 
// 23 independent variables for tabulation. (Symmetry relations for the resistance 
// functions are given in [JO eqn. 1.9] and [J eqn. 5])
//
// The minus signs in the symmetry relations will be taken care of naturally 
// by the per-particle operations. 
//
// NOTE: The resistance functions are tabulated for 1000 distances 
//       spaced logarithmically between 2.000100 and 4.000000. 
//
// NOTE: The scalar functions are saved in the following order: 
//       [ XA11, XA12, YA11, YA12, YB11, YB12, XC11, XC12, YC11, YC12, 
//         XG11, XG12, YG11, YG12, YH11, YH12, 
//         XM11, XM12, YM11, YM12, ZM11, ZM12 ] 
//
// NOTE: The data is stored contiguously for each distance, i.e. 
//       [ XA11, ..., ZM12 ]_1, ..., [ XA11, ..., ZM12 ]_n // 
// 
